create table avtopark (
	id BIGSERIAL PRIMARY KEY NOT NULL,
	haydovchi VARCHAR(50) NOT NULL,
	daromad NUMERIC(10,2) NOT NULL,
	moshina_nomi VARCHAR(50) NOT NULL,
	model VARCHAR(50) NOT NULL,
	moshin_yili NUMERIC(4) NOT NULL,
	mashina_raqami NUMERIC(3) NOT NULL,
	moshina_rangi VARCHAR(10) NOT NULL
);
